import React from 'react'
import Link from 'next/link';

import styled from 'styled-components'

const Div = styled.div`
  font-size: 50px;
  background-color: ${({ theme }) => theme.colors.primary};
`
const Nav = () => (
    <Div>
        <Link href="/">
            <a>Home</a>
        </Link>
        <Link href="/about">
            <a>About</a>
        </Link>
        <Link href="/post">
            <a>Post</a>
        </Link>
    </Div>
);

export default Nav;
